import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import HomePage from './Pages/Homepage/Homepage';
import phone from './Pages/Repair/Phone/Phone';
import Phone from './Pages/Repair/Phone/Phone';


const app = () => {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" render={() => <div><h1>hello</h1></div>}/>
        {/* <Route path="/phone" component={Phone}/> */}


      </Routes> 
    </BrowserRouter>
  )

}


export default app;
